import React, { useEffect, useState } from "react";
import axios from "axios";

export default function DashboardPage() {
  const [results, setResults] = useState([]);
  const [message, setMessage] = useState("");
  const token = localStorage.getItem("promptpal_token");

  useEffect(() => {
    axios
      .get("http://localhost:8080/api/prompt", {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((res) => setResults(res.data))
      .catch(() => setMessage("No results yet."));
  }, []);

  const handleGenerate = async () => {
    try {
      const res = await axios.post("http://localhost:8080/api/prompt/generate", {}, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setResults([res.data, ...results]);
    } catch {
      setMessage("‚ùå Failed to generate advice.");
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 to-gray-100 py-10">
      <div className="max-w-3xl mx-auto bg-white shadow-xl rounded-2xl p-8">
        <h2 className="text-3xl font-bold text-center text-gray-800 mb-6">
          Your Personalized AI Recommendations
        </h2>
        <div className="flex justify-center mb-6">
          <button
            onClick={handleGenerate}
            className="bg-blue-600 hover:bg-blue-700 text-white font-semibold py-2 px-6 rounded-lg transition-all"
          >
            Generate New Advice
          </button>
        </div>
        {message && <p className="text-center text-gray-600">{message}</p>}
        <div className="space-y-6">
          {results.map((r) => (
            <div
              key={r.id}
              className="bg-blue-50 border border-blue-100 rounded-xl p-5 shadow-sm"
            >
              <p className="font-semibold text-blue-800 mb-2">üß† Prompt:</p>
              <p className="text-gray-700 mb-3">{r.prompt_text}</p>
              <p className="font-semibold text-blue-800 mb-2">üí° Response:</p>
              <p className="text-gray-700">{r.ai_response}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
